import React from 'react';
import { getImageUrl } from './component/user';
function Avatar(size , person){
    return(
        <img 
        className="avatar"
        src="https://i.imgur.com/1bX5QH6.jpg"
        alt='person alia'
        width={size}
        height={size}
        />
    );
}
export default function Profile(){
    return(
        <div>
            <Avatar 
             size = {100}
             person = {{
                name: 'Ali',
                imageid : 'ifjrk'
             }}
            />
            <Avatar 
             size = {90}
            />
            <Avatar 
             size = {70}
            />
        </div>
    );
}
